  const {getTasks} = useTasks();

  useEffect(() => {
    getTasks();
  }, [])

  const {user} = useAuth();
  console.log(user);
  return (
    <div>
      <h1>TasksPage</h1>
      {user.nombre}
    </div>
  )
}
